variable.closeArray.push(candle.close)

if (variable.closeArray.length > len) { variable.closeArray.splice(0, 1) }

//Linear regresion on index and log returns 
let sumY = 0
let sumX = 0
let sumXY = 0
let sumX2 = 0
let sumY2 = 0
for (var i = 0; i < len; i++) {
    sumY += variable.closeArray[i]
    sumX += i
    sumXY += variable.closeArray[i] * i
    sumY2 += Math.pow(variable.closeArray[i], 2)
    sumX2 += Math.pow(i, 2)
}

//Slope 
let slope = ((len * sumXY) - sumX * sumY) / ((len * sumX2) - Math.pow(sumX, 2))

//Intercept 
let intercept = ((sumY - slope * sumX) / len)

//Linear regression function 
let Y = slope * len + intercept
variable.prevY = Y

//IE2
//Integral of Linear Regression Slope + Endpoint Moving Average / 2 
variable.ie2 = (2 * Y - variable.prevY + calcSMA(variable.closeArray, len)) / 2

//NaN -> 0
variable.ie2 = variable.ie2 || 0

// Moving average
function calcSMA(values, periods) {
    if (values.length < periods) { return 0 }

    let sum = 0
    for (let i = values.length - periods; i < values.length; i++) {
        sum = sum + values[i]
    }
    let sma = sum / periods
    return sma
}

